import {InputBase,Box ,styled} from '@mui/material';

const SearchContainer = styled(Box)`
background:#fff;
width:38%;
border-radius:2px;
margin-left:10px;
`
const Search  = ()=> {
    return (
        <SearchContainer>
        <InputBase
        placeholder ="Search for product,brand and more"
        />
        </SearchContainer>
    )
}
export default Search;
